export function setImages(images){
    return{
        type:'SetImage',
        images
    }
}
export function fetchImages(id){
    console.log(id);
    return dispatch =>{
        fetch(`http://localhost:8000/images/${id}`)
                    .then(res => res.json())
                    .then(json => {
                        dispatch(setImages(json))                   
            })
        };
    }
